import React, { useState } from 'react';
import { useAuth } from '../../context/AuthContext';
import { user } from '../../api/client';
import toast from 'react-hot-toast';

const AvatarUpload: React.FC = () => {
  const { user: currentUser, updateUser } = useAuth();
  const [avatarUrl, setAvatarUrl] = useState(currentUser?.avatarUrl || '');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    if (!avatarUrl.trim()) {
      toast.error('Please enter a Bitmoji URL');
      return;
    }

    setLoading(true);
    try {
      const response = await user.updateAvatar(avatarUrl.trim());
      updateUser(response.data);
      toast.success('Bitmoji updated successfully!');
    } catch (error: any) {
      console.error('Error updating Bitmoji:', error);
      toast.error(error.response?.data?.message || 'Failed to update Bitmoji');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="mt-6 p-4 bg-white dark:bg-gray-800 rounded-lg shadow">
      <h3 className="text-lg font-medium text-gray-900 dark:text-white mb-4">Your Bitmoji</h3>

      {currentUser?.avatarUrl && (
        <div className="mb-4">
          <img
            src={currentUser.avatarUrl}
            alt="Your Bitmoji"
            className="w-24 h-24 rounded-full mx-auto"
          />
        </div>
      )}

      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label htmlFor="avatarUrl" className="block text-sm font-medium text-gray-700 dark:text-gray-300">
            Bitmoji URL
          </label>
          <input
            type="url"
            id="avatarUrl"
            value={avatarUrl}
            onChange={(e) => setAvatarUrl(e.target.value)}
            placeholder="Enter your Bitmoji URL"
            className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-primary-500 focus:ring-primary-500 dark:bg-gray-700 dark:border-gray-600 dark:text-white sm:text-sm"
          />
          <p className="mt-1 text-sm text-gray-500 dark:text-gray-400">
            Paste the URL of your Bitmoji image here
          </p>
        </div>

        <div className="flex items-center space-x-2">
          <button
            type="submit"
            disabled={loading}
            className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 disabled:opacity-50"
          >
            {loading ? 'Updating...' : 'Update Bitmoji'}
          </button>
          {currentUser?.avatarUrl && (
            <button
              type="button"
              onClick={async () => {
                setLoading(true);
                try {
                  const response = await user.updateAvatar('');
                  updateUser(response.data);
                  setAvatarUrl('');
                  toast.success('Bitmoji removed successfully!');
                } catch (error: any) {
                  console.error('Error removing Bitmoji:', error);
                  toast.error(error.response?.data?.message || 'Failed to remove Bitmoji');
                } finally {
                  setLoading(false);
                }
              }}
              disabled={loading}
              className="inline-flex items-center px-4 py-2 border border-gray-300 rounded-md shadow-sm text-sm font-medium text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 disabled:opacity-50 dark:bg-gray-700 dark:border-gray-600 dark:text-gray-300 dark:hover:bg-gray-600"
            >
              Remove Bitmoji
            </button>
          )}
        </div>
      </form>

      <div className="mt-4">
        <h4 className="text-sm font-medium text-gray-900 dark:text-white mb-2">How to get your Bitmoji URL:</h4>
        <ol className="list-decimal list-inside text-sm text-gray-600 dark:text-gray-400 space-y-1">
          <li>Go to <a href="https://www.bitmoji.com" target="_blank" rel="noopener noreferrer" className="text-primary-600 hover:text-primary-500">Bitmoji.com</a></li>
          <li>Create or customize your Bitmoji</li>
          <li>Find the Bitmoji pose you want to use</li>
          <li>Right-click on the image and select "Copy Image Address"</li>
          <li>Paste the URL in the input field above</li>
        </ol>
      </div>
    </div>
  );
};

export default AvatarUpload;
